webpackJsonp([0x642923127f53],{1356:function(A,t){A.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2008-04-27-people-for-the-ethical-treatment-of-yeast-pety/index.md absPath of file >>> MarkdownRemark",html:'<p>The next time you take a bite out of that yummy loaf of bread consider where it came from. Sure, cutting down all that nasty wheat is harmless enough. After all it\'s just a stupid plant. It doesn\'t have feelings. However, consider the condition of yeast.</p>\n<p>Here is how yeast is brought to market:</p>\n<p>How would you like to live in those conditions?</p>\n\n  <a class="gatsby-resp-image-link" href="/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-db0af.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="img 9274" title="" src="/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-b80fa.jpg" srcset="/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-cf410.jpg 163w,\n/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-62f2a.jpg 325w,\n/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-b80fa.jpg 650w,\n/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-08cb4.jpg 975w,\n/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-f2bf9.jpg 1300w,\n/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-fd4ba.jpg 1950w,\n/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-db0af.jpg 3264w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n<p>After that kind of treatment being introduced into a warm, nutrient rich environment like this:\n<a href=""><img src="" alt="Bread Dough"></a>\nI am sure feels like heaven.</p>\n<p> []: <a href="http://www.flickr.com/photos/jasmic/302657002/">http://www.flickr.com/photos/jasmic/302657002/</a></p>\n<p>but next comes this:\n<a href=""><img src="" alt="Bread Oven"></a>\nat 450 degrees. I can hear the shriek of millions of individual yeasts shrieking out in terror like Joan of Arc as they face their final moments in a fiery furness.</p>\n<p> []: <a href="http://www.flickr.com/photos/bastian/2125007811/">http://www.flickr.com/photos/bastian/2125007811/</a></p>\n<p>So next time you eat this:\n<a href=""><img src="" alt="Bread"></a>\nJust think of the millions of dead bodies sacrificed so you can have light and fluffy bread.</p>\n<p> []: <a href="http://www.flickr.com/photos/hlk/389341090/">http://www.flickr.com/photos/hlk/389341090/</a></p>\n<p>It\'s time to be PETY.</p>',frontmatter:{title:"People for the Ethical Treatment of Yeast (PETY)",date:"April 27, 2008",imageUrl:null,image:{childImageSharp:{sizes:{src:"/static/img_9274-c711ad88d84fb701550dcd6645a4eb8d-381d6.jpg"}}}}}},pathContext:{path:"/people-for-the-ethical-treatment-of-yeast-pety"}}}});
